function getRandomInt(min, max) {
    return Math.floor(Math.random() * (max - min + 1)) + min;
}

function getNewsArticleData(data, _that){
    $.ajax({
        url: "/ajax.php",
        type: "POST",
        data: data,
        dataType: 'html',
        success: function(response, textStatus, jqXHR){
            if (response != ''){
                _that.parent('div').next('.inf_newsarticle_list').html(response);
                _that.parent('div').data('page', data.page);
            }
        }
    });
}

function getTitleTimeZone(tz){
    var resultText = '';
    var timeZones = {
        'Europe/Kiev':'',
        'Europe/Zaporozhye':'',
        'Europe/Simferopol':'',
        'Europe/Minsk':'',
        'Europe/Kaliningrad':'',
        'Europe/Moscow':'',
        'Europe/Samara':'',
        'Asia/Ashgabat':'',
        'Asia/Tbilisi':'',
        'Asia/Tashkent':'',
        'Asia/Samarkand':'',
        'Asia/Vladivostok':'',
        'Asia/Yakutsk':'',
        'Asia/Omsk':'',
        'Asia/Novosibirsk':'',
        'Asia/Novokuznetsk':'',
        'Asia/Magadan':'',
        'Asia/Krasnoyarsk':'',
        'Asia/Kamchatka':'',
        'Asia/Irkutsk':'',
        'Asia/Chita':'',
        'Asia/Bishkek':'',
        'Asia/Baku':'',
        'Asia/Yekaterinburg':'',
        'Asia/Yerevan':'',
    };
    if (typeof tz != "undefined" &&
        typeof tz != "null" &&
        tz != '' &&
        typeof timeZones[tz] != "undefined" &&
        typeof timeZones[tz] != "null"
    ){
        resultText = timeZones[tz];
    }
    return resultText;
}

