ruggerApp.controller('competitionStaffListController', ['$scope', '$rootScope', '$http', '$sce', function ($scope, $rootScope, $http, $sce) {

    // init start data
    $scope.staffData = {
        'points': [],
        'competition_id': 0,
        'championship_id': 0,
    };
    $scope.loadingData = false;

    $scope.$watch("appStaffData", function(){
        $scope.staffData.competition_id = $scope.appStaffData.competition_id;
        $scope.staffData.championship_id = $scope.appStaffData.championship_id;
        $scope.staffData.points = $scope.appStaffData.points;
        $scope.staffData.show = $scope.staffData.points;
    });

    $scope.getCompetitionStaff = function(type) {
        //console.log('getCompetitionStaff;');
        var type_key = '';
        switch(type) {
            case 'p':
                type_key = 'points';
                break;
            case 't':
                type_key = 'pop';
                break;
            case 'sh':
                type_key = 'sht';
                break;
            case 'r':
                type_key = 'pez';
                break;
            case 'dg':
                type_key = 'd_g';
                break;
            case 'zhk':
                type_key = 'y_c';
                break;
            case 'kk':
                type_key = 'r_c';
                break;
        }
        if (typeof $scope.staffData[type_key] != "null" &&
            typeof $scope.staffData[type_key] != "undefined" &&
            $scope.staffData[type_key].length != 0) {
            $scope.staffData.show = $scope.staffData[type_key];
        } else {
            if (!$scope.loadingData) {
                $scope.loadingData = true;
                var params = {
                    action: 'get_competition_staff',
                    championship_id: $scope.staffData.championship_id,
                    'type': type_key
                };
                $http({
                    method: 'POST',
                    url: $rootScope.api,
                    data: $.param(params),
                    headers: { 'Content-Type': 'application/x-www-form-urlencoded' }
                }).success(function(data, status, headers, config) {
                    //console.log(data);
                    if (typeof data.staff != "null" &&
                        typeof data.staff != "undefined" &&
                        data.staff != "null" &&
                        data.staff != "" &&
                        data.staff != null){
                        if (data.staff.length>0){
                            $scope.staffData[type_key] = [];
                            for (var i = 0; i < data.staff.length; i++) {
                                $scope.staffData[type_key].push(data.staff[i]);
                            }
                        }
                        $scope.staffData.show = $scope.staffData[type_key];
                        //console.log('show: ', $scope.staffData.show);
                    }
                    $scope.loadingData = false;
                }).error(function(data, status, headers, config) {
                    $scope.loadingData = false;
                });
            }
        }
    };

}]);
